        ctx.lineTo(window.innerWidth / 2 - 50, cameraOffset.y / 2 * 1.8 - dragY);
        ctx.lineTo(window.innerWidth / 2 - 130, cameraOffset.y / 2 * 2.5 - dragY);
        ctx.closePath();
        ctx.lineTo(window.innerWidth, cameraOffset.y / 2 * 2.5 - dragY);

